import styles from "./MealItemForm.module.css";

const MealItemForm = () => {
  return (
    <form className={styles.form}>
      <div>
        <label htmlFor="amount">Amount</label>
        <input type="number"></input>
      </div>
      <button type="submit">+ Add</button>
    </form>
  );
};

export default MealItemForm;
